import React from "react";
import styled from "styled-components";


class Group13916 extends React.Component {
  render() {
    const { className } = this.props;

    return (
      <Group13912 className={`group-13912 ${className || ""}`}>
        <Group className="group-5" src="/img/group-65@2x.svg" />
      </Group13912>
    );
  }
}

const Group13912 = styled.div`
  height: 16px;
  display: flex;
  padding: 3.9px 3px;
  align-items: flex-start;
  min-width: 16px;
  background-color: var(--westar);
  border-radius: 8px;

  &.group-13912.group-13912-1 {
    margin-top: 0;
    border-radius: 8px/7.97px;
  }

  &.group-13912.group-13917 {
    margin-left: 385px;
  }

  &.group-13912.group-13918 {
    margin-left: 389px;
  }

  &.group-13912.group-13913 {
    position: absolute;
    top: 674px;
    left: 258px;
  }

  &.group-13912.group-13914 {
    position: absolute;
    top: 674px;
    left: 757px;
  }

  &.group-13912.group-13915 {
    position: absolute;
    top: 674px;
    left: 1253px;
  }

  &.group-13912.group-13912-3 {
    margin-top: 10px;
    margin-left: 36px;
  }
`;

const Group = styled.img`
  width: 10px;
  height: 8px;
`;

export default Group13916;
